import React, { useState,useEffect } from 'react';
import alanBtn from '@alan-ai/alan-sdk-web';

const App = () => {
    const [key] = useState(null);
    useEffect(() => {
        alanBtn({
            key:'41451801c5be1cc25d558341b0b04d782e956eca572e1d8b807a3e2338fdd0dc/stage' ,
            onCommand: ({ command }) => {
                    alert('This code was executed');
            }
        })
    }, []);
    return (
        <div><h1>Alan AI News Application</h1></div>);
}
export default App;
